import { brake, oil, tire, battery } from 'images/tips';

export type GalleryItem = {
  src: string;
  alt: string;
  caption?: string;
};

export const gallery: GalleryItem[] = [
  { src: brake, alt: 'Motor recondiționat, compartiment curat', caption: 'Recondiționare motor' },
  { src: oil, alt: 'Schimb plăcuțe și discuri frână', caption: 'Frâne noi' },
  { src: tire, alt: 'Service A/C – încărcare freon', caption: 'Climatizare' },
  { src: battery, alt: 'Diagnoză computerizată – OBD', caption: 'Diagnoză OBD' },
];

// Dacă vrei să repeți imaginile până faci 20 (ca în codul tău inițial):
export const galleryExtended: GalleryItem[] = Array(5)
  .fill(gallery)
  .flat();
